def count_reordering_ways(n, m, serial_numbers):
    mod = 10 ** 9 - 7
    if not m:
        return 0
    mx = [0] * (n + 1)
    mn = [mod] * (n + 1)
    for i in range(n):
        if mx[i] > serial_numbers[i]:
            mx[i + 1] = mx[i]
        else:
            mx[i + 1] = serial_numbers[i]
    for i in range(n - 1, -1, -1):
        if mn[i + 1] < serial_numbers[i]:
            mn[i] = mn[i + 1]
        else:
            mn[i] = serial_numbers[i]
    dp = [0] * (n + 1)
    dp[1] = 2
    for i in range(1, n):
        ndp = [0] * (n + 1)
        check0 = mx[i + 1] == serial_numbers[i]
        check1 = mn[i + 1] >= mx[i]
        check2 = mn[i] == serial_numbers[i]
        if check0:
            if check1:
                for j in range(i + 1):
                    ndp[j + 1] += dp[j]
                    ndp[i - j + 1] += dp[j]
            else:
                for j in range(i + 1):
                    ndp[j + 1] += dp[j]
        elif check2:
            for j in range(i + 1):
                ndp[j] += dp[j]
        dp = [x % mod for x in ndp]
    ans = 0
    for i in range(n - m, m + 1):
        ans += dp[i]
        ans %= mod
    return ans

